class Game:
    def __init__(self, id, fen, best):
        self.id = id
        self.fen = fen
        self.best = best

def GetRandomGame():
    return games[random.choice(range(0, 2059))]

def GetBoardVisualFromFen(fen):
    visualBoard = ""
    lines = fen.split(' ')[0].split('/')
    for count in range(17):
        if count % 2 == 0:
            visualBoard += "+---+---+---+---+---+---+---+---+\n"
        else:
            c = ceil(count/2-1)
            visualBoard += "|"
            for line in lines[c]:
                for char in line:
                    if char.isdigit():
                        for x in range(int(char)):
                            visualBoard += "   |"
                    else:
                        visualBoard += " " + char + " |"
            visualBoard += " " + str(int((17-count)/2)) + "\n"
    return visualBoard

def WriteSlowly(sentence):
    for char in sentence:
        sys.stdout.write(char)
        sys.stdout.flush()
        time.sleep(0.1)
    sys.stdout.write("\n")

global good_answer

good_answer = 0

def GetNewGame(message):
    global good_answer
    game = GetRandomGame()
    print(message)
    print(GetBoardVisualFromFen(game.fen))
    start_time = time.time()
    answer = input("Next move: ")
    end_time = time.time()

    if (game.best == answer.lower().strip()):
        good_answer += 1

    return end_time-start_time



